import "imStyles/vssue.styl";
export default {
  name: "MyVssue",
  render (h) {
    if (process.env.NODE_ENV === "development") {
      var name = "development";
    } else {
      var name = "production";
    }
    return h("Vssue", {
      props: {
        title: this.$page.title,
        options: this.$themeConfig.vssue[name]
      },
      class: {
        "vssue-warp": "vssue-warp"
      }
    });
  }
};
